import React from 'react';
import './MenuItem.css';

const MenuItem = ({ image, title, link }) => {
  return (
    <div className='card'>
      <img className='img' src={image} alt={title} />
      <p>{title}</p>
    </div>
  );
};

export default MenuItem;
